import React from 'react';
import ReactTable from 'react-table-6';
import 'react-table-6/react-table.css';
import data from './MOCK_DATA.json';

class PastBookingsTable extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            pastBookings: []
        }
    }

    componentDidMount() {
        console.log("called");
        fetch(data, {
            method: "GET"
        }).then(response => response.json()).then(pastBookings => {
            console.log("Bookings", pastBookings).catch(err => console.error(err));
        })
    }

    render() {

        const columns = [
            {
                Header: "Service Provider"
            },
            {
                Header: "Employee"
            },
            {
                Header: "Date"
            }
        ]

        return (
            <div>
                <ReactTable columns={columns} />
            </div>
        )
    }
}

export default PastBookingsTable;
